import React from 'react'
import './Sidebar.css'
import Logo from '../../imgs/logo.png'

const Sidebar = () => {
    return (
        <div>Sidebar
            {/* logo */}
            <div className="logo">
                <img src="Logo" alt="IIT-B Dept of ET" />
                <span>IIT-B eTui</span>
            </div>
        </div>
    )
}

export default Sidebar
